import React from "react";
import ContentLoader from "react-content-loader";
import './css/contentLoader.css'
function ReactContent(props){
    return(
        <div className="ContentLoader">
            <ContentLoader 
                seed={1} 
                width="500px" 
                height="100vh" 
                backgroundColor="#666667" 
                foregroundColor="#161E20"
                {...props}
            >
                <rect x="0" y="200" rx="25" ry="25" width="500" height="72"/>
                <rect x="0" y="350" rx="25" ry="25" width="500" height="72"/>
            </ContentLoader>
            
        </div>
    );
}

export {ReactContent};
